import './Home.css';


const Home = () => {
  return (
    <div className="home-container">
        <div className="hero-content">
          <img src= "/IMG_6460.png" alt="Pranav" className="profile-picture" />
          <div className="text-content">
            <p id = "intro">Hi, my name is </p>
            <h1>Pranav Malhotra</h1>
            <p>I'm a software engineer specializing in building and designing innovative digital experiences.</p>
            <p> Post Graduate Certificate(Co-Op) - Fanshawe College</p>
            <div className="cta-buttons">
              <a href="/projects" className="btn">View Projects</a>
            </div>
          </div>
      </div>
    </div>
  );
}

export default Home;
